import React, {Component} from 'react';
import axios from "./ProfilesPage";

class Profile extends Component {
    constructor(props) {
        super(props);
        // Don't call this.setState() here!
        this.state = {cat: {}};
    }

    componentDidMount() {
        const url = 'http://localhost:5000';
        const catsUrl = `${url}/api/cats/${this.props.match.params.id}`;

        axios.get(catsUrl).then(response => response.data)
            .then((data) => {
                this.setState({cats:data});
                console.log(this.state.cats)
            });
    }

    render() {
        return (
            <div className="cat-profile">
                <h1 className="name">Baby{this.props.match.params.id}</h1>
                <img className="profile-pictures" alt=""/>
                <p className="about">I'm looking for someone to feed me, open the door when I need it, and give
                    snuggles.</p>
                <div className="character-badges">
                    <span className="badge">Meow! (I'm a talker!)</span>
                </div>
            </div>
        )
    };
}
export default Profile;
